import React from 'react';
import {Col, Panel, Row} from 'rsuite';
// import AreaChart from './AreaChart';
// import BarChart from './BarChart';
import RadarChart from './RadarChart';

export type CardSection3Props={

  AreaChartData?:any
  BarChartData?:any
  RadarChartData?:any
  graphData?:any
}


const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);


const CardSection3 = (props: CardSection3Props)=>{
  const getcardsec3 = () =>{
    const coutput:any = [];
    Array.isArray(props?.graphData) && props?.graphData.forEach(items=>{
      coutput.push(
        <><RadarChart
          RadarChartData={items?.cardsection3.radarchart} />
          <RadarChart
            RadarChartData={items?.cardsection3.radarchart} /></>

      )
    });
    return coutput;
  }

return (
  <Row>
       <Col md={8} sm={12}>
         <Card  ><div style={{height:"500px"}}>
     {getcardsec3()}

           </div></Card>
       </Col>
  </Row>
)

}













